import React, { useEffect } from "react";

const ImImagesRes = () => {



const FetchImagesData = ( )=>{
   fetch(`https://pixabay.com/api/?key=38320105-b762e964374d782b30b2f8654&q=yellow+flowers&image_type=photo`)
   .then(res=>res.json())
   .then(ImageData =>{
    console.log(ImageData)
   })
}






useEffect(()=>{
FetchImagesData();
},[])








  return (
    <>
       <div className="Im-Images-Container">
           <div className="Im-Images-Container-box">

           </div>
       </div>
    </>
  );
};

export default ImImagesRes;
